import React, { Component } from "react";

import { getBooks } from "../routes/books";
class BookList extends Component {
  state = { bookList: [] };

  componentDidMount() {
    const list = getBooks().then(results => {
      return results.data;
    });
    this.setState({ bookList: list });
  }
  render() {
    console.log(this.state.bookList);
    return (
      <React.Fragment>
        <table className="table">
          <thead>
            <tr>
              <th scope="col">#</th>
              <th scope="col">Book Name</th>
              <th scope="col">Total Pages</th>
              <th scope="col">Current Page</th>
              <th scope="col">Progress</th>
              <th scope="col">Completed</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <th scope="row">1</th>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
            <tr>
              <th scope="row">2</th>
              <td>Jacob</td>
              <td>Thornton</td>
              <td>@fat</td>
            </tr>
            <tr>
              <th scope="row">3</th>
              <td>Larry</td>
              <td>the Bird</td>
              <td>@twitter</td>
            </tr>
          </tbody>
        </table>
      </React.Fragment>
    );
  }
}

export default BookList;
